export async function getLectureDetailById(id) {
  let resultLecture = "";
  try {
    const response = await axios.get(
      `localhost:8080/lectures/getalllectures/${id}`
    );
    console.log("데이터", response.data);
    let i = 0;
    for (i = 0; i < response.data.length; i++) {
      if (response.data[i].lectureId == id) {
        resultLecture = response.data[i];
      }
    }
  } catch (error) {
    console.log("아이디 찾는 중 오류발생", error);
  }
  return resultLecture;
}
